import React from "react";
import { Link } from "react-router-dom";
import NavBar from "./NavBar";

const Home = () => {
  return (
    <div>
    <NavBar/>
    <div style={{ display: "flex", justifyContent: "center" }}>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          gap: "20px",
        }}
      >
        <Link to="/create">
          <div
            style={{
              width: "200px",
              height: "200px",
              backgroundColor: "#eaeaea",
              borderRadius: "10px",
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              boxShadow: "0px 2px 5px rgba(0, 0, 0, 0.2)",
              cursor: "pointer",
            }}
          >
            <h2>Create a User</h2>
          </div>
        </Link>

        <Link to="/read">
          <div
            style={{
              width: "200px",
              height: "200px",
              backgroundColor: "#eaeaea",
              borderRadius: "10px",
              display: "flex",
              justifyContent: "center",
              alignItems: "center",
              boxShadow: "0px 2px 5px rgba(0, 0, 0, 0.2)",
              cursor: "pointer",
            }}
          >
            <h2>See All Users</h2>
          </div>
        </Link>
      </div>
    </div>
    </div>
  );
};

export default Home;
